import React from 'react'

function Photo() {


  // Return:
  return (
    <div className="main">
      <img src={this.props.photo} alt="Not Here." />
      <div>
        <h4>{this.props.title}</h4>
        <p>{this.props.description}</p>
      </div>
    </div>
  );

}

export default Photo;
